import React, { useEffect, useState }  from 'react';
import axios from "axios";
import { Header } from 'semantic-ui-react';

function RoverData(){
   // new line start
  const [profileData, setProfileData] = useState(null)


  useEffect(() => {
    getData();
  }, []);

  function getData() {
    axios({
      method: "GET",
      url:"/waypoint",
    })
    .then((response) => {
      const res = response.data
      setProfileData(({
        profile_name: res.name,
        about_me: res.about}))
    }).catch((error) => {
      if (error.response) {
        console.log(error.response)
        console.log(error.response.status)
        console.log(error.response.headers)
        }
    })}

  return (
    <div>

        {/* new line start*/}
        <Header as="h2">Rover Data</Header>
	{profileData && <div>
              <Header as="h3">Profile name: {profileData.profile_name}</Header>
              <Header as="h3">About me: {profileData.about_me}</Header>
	      </div>
	}

         {/* end of new line */}
    </div>
  );
}

export default RoverData;
